// Removes null, undefined, and empty string values from the object
function clean(obj) {
  for (var propName in obj) {
    if (obj[propName] === null || obj[propName] === undefined || obj[propName] === '') {
      delete obj[propName];
    }
  }
  return obj;
}

return items.map(item => {
  return { json: clean(item.json) };
});
